    <h1 class="title">Zedd <span class="small-text"> Russian-German DJ</span></h1>
    <p>I love the music <a href="https://en.wikipedia.org/wiki/Zedd">Zedd</a> produces. He is able to incorporate a <b>unique blend</b> of classical components with modern electronic sounds. Personally, I really like the song <a href="https://www.youtube.com/watch?v=yWEK4v9AVKQ">Stay</a> by Zedd and Alessia Cara.</p>
